  return (
    <div className={styles.container}>
      <Header />
      <main className={styles.main}>
        <Link  to={`./dispatcher`}>
          <img className="pizza-block__image"
               src={''}
               width="584"
               height="584"
               alt="Pizza"/>
          <h4 className="pizza-block__title">{title}</h4>
        </Link>
      </main>
    </div>
  );
}

export default Main;
